import React from "react";
import Login from "./Login";
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {
  render () {
    return (
      <>
        <h1 className="mx-auto w-auto d-block">Вход в личный кабинет</h1>
        <Login/>
      </>
    )
  }
}

export default App;
